import React from "react";
import { BrowserRouter , Routes, Route, Redirect}  from "react-router-dom";

import User from './User/pages/users';

const App = () => { 

 return <BrowserRouter>
 <Routes>
    <Route path="/User" element={<User />} exact />
    </Routes> 
    <Redirect to='/User'/>
    </BrowserRouter>


}




export default App;
